import { useState } from "react";
import Sidebar from "./Sidebar";

export default function Navbar() {
  const [open, setOpen] = useState(false);

  return (
    <>
      <Sidebar open={open} onClose={() => setOpen(false)} />

      <div style={{
        height: 60,
        background: "#5b9491",
        color: "white",
        display: "flex",
        alignItems: "center",
        padding: "0 20px",
        justifyContent: "space-between"
      }}>

        {/* ✅ HAMBURGER BUTTON */}
        <button
          onClick={() => setOpen(true)}
          style={{
            fontSize: 28,
            background: "none",
            border: "none",
            color: "white",
            cursor: "pointer"
          }}
        >
          ☰
        </button>

        <h2>BrainTease</h2>

        <div>
          Guest | <button style={{ marginLeft: 10 }}>Logout</button>
        </div>
      </div>
    </>
  );
}
